import React, { Component } from 'react';
import Foundation, {Callout, Link, Menu, MenuItem} from 'react-foundation';
import {BadgeColors as Colors, ButtonGroupSizes as Sizes} from "react-foundation/src/enums";

class App extends Component {
  render() {
    return (
        <div className="row align-center">
            <div className="columns shrink align-center">
                <div>
                    <Menu>
                        <MenuItem isActive><a>Home</a></MenuItem>
                        <MenuItem><a>Messages</a></MenuItem>
                        <MenuItem><a>Profile</a></MenuItem>
                    </Menu>
                </div>
            </div>
        </div>

    );
  }
}

export default App;
